import * as L from 'leaflet';


export function icon(name){
    const ICON = L.icon({
        iconUrl: 'https://mappinghistorybucket.s3.us-east-2.amazonaws.com/MappingHistoryMarker/'+name,
        iconSize: [60, 60],
    })
    return ICON;
}

export async function iconRandom(name){

    const respons = await fetch("http://localhost:5001/createImages",{
        method:'POST',
        headers:{
        'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          prompt:name
        })
      })

      if(respons.ok){
          const data = await respons.json();
          const parsedData = data.bot.trim();
          console.log(parsedData);
      }else{
          alert("error")
      }

    const ICON = L.icon({
        iconUrl: 'https://source.unsplash.com/50x50/?'+name,
        iconSize: [60, 60],
    })
    return ICON;
}


export const ICONRED = L.icon({
    iconUrl: "icon-red.png",
    iconSize: [40, 40],
})

export const ICONBLUE = L.icon({
    iconUrl: "icon.png",
    iconSize: [40, 40],
})


